import './Home.css';

function Home() {
	return (
		<div className='Home'>
			<div id='intro'>
				<div id='intro-name'>AASHNA VERMA</div>
				<div>- Software engineering student -</div>
				<div className='circle'></div>
			</div>
		</div>
	);
}

export default Home;
